import React, { useState } from "react";
import axios from "axios";
import "./App.css"; // Importing custom styles

const App = () => {
    const [query, setQuery] = useState("");
    const [severity, setSeverity] = useState("");
    const [attackType, setAttackType] = useState("");
    const [results, setResults] = useState([]);
    const [page, setPage] = useState(1);
    const [totalPages, setTotalPages] = useState(1);

    // Function to fetch search results
    const searchIncidents = async () => {
        const response = await axios.get("http://localhost:8001/search", {
            params: { query, severity, attack_type: attackType, page, size: 10 },
        });
        setResults(response.data.results);
        setTotalPages(response.data.total_pages);
    };

    const handlePageChange = (newPage) => {
        setPage(newPage);
        searchIncidents(); // Trigger search with new page number
    };

    // Function to add a new incident
    const addIncident = async (incident) => {
        await axios.post("http://localhost:8001/incidents", incident);
        searchIncidents(); // Refresh the incident list after adding
    };

    // Function to update an incident
    const updateIncident = async (incidentId, updatedData) => {
        await axios.put(`http://localhost:8001/incidents/${incidentId}`, updatedData);
        searchIncidents(); // Refresh the incident list after updating
    };

    // Function to delete an incident
    const deleteIncident = async (incidentId) => {
        await axios.delete(`http://localhost:8001/incidents/${incidentId}`);
        searchIncidents(); // Refresh the incident list after deleting
    };

    return (
        <div className="container">
            <h1 className="title">Incident Search Dashboard</h1>

            <div className="form-group">
                <input
                    type="text"
                    className="search-input"
                    placeholder="Search title"
                    value={query}
                    onChange={(e) => setQuery(e.target.value)}
                />
                <select
                    className="dropdown"
                    onChange={(e) => setSeverity(e.target.value)}
                >
                    <option value="">All Severities</option>
                    <option value="high">High</option>
                    <option value="medium">Medium</option>
                    <option value="low">Low</option>
                </select>
                <select
                    className="dropdown"
                    onChange={(e) => setAttackType(e.target.value)}
                >
                    <option value="">All Attack Types</option>
                    <option value="Unauthorized Access">Unauthorized Access</option>
                    <option value="Phishing">Phishing</option>
                </select>
                <button className="search-btn" onClick={searchIncidents}>
                    Search
                </button>
            </div>

            <div className="actions">
                <button className="action-btn" onClick={() => addIncident({ title: "New Incident", description: "Description" })}>
                    Add Incident
                </button>
            </div>

            <ul className="results-list">
                {results.map((result, index) => (
                    <li key={index} className="result-item">
                        <strong>{result.title}</strong>: {result.description}
                        <div className="action-buttons">
                            <button
                                className="update-btn"
                                onClick={() => updateIncident(result.id, { description: "Updated description" })}
                            >
                                Update
                            </button>
                            <button
                                className="delete-btn"
                                onClick={() => deleteIncident(result.id)}
                            >
                                Delete
                            </button>
                        </div>
                    </li>
                ))}
            </ul>

            <div className="pagination">
                <button
                    onClick={() => handlePageChange(page - 1)}
                    disabled={page === 1}
                    className="page-btn"
                >
                    Previous
                </button>
                <span> Page {page} of {totalPages} </span>
                <button
                    onClick={() => handlePageChange(page + 1)}
                    disabled={page === totalPages}
                    className="page-btn"
                >
                    Next
                </button>
            </div>
        </div>
    );
};

export default App;
